import React from "react";
import { View } from "react-native";
import img from "../../../assets/icon.png";
import { Container, Option, Img, Label } from "./styles";

const Suggestions = () => {
  return (
    <Container>
      <Option>
        <Img source={img} />
        <Label>Doações</Label>
      </Option>
    </Container>
  );
};

export default Suggestions;
